    vector<Hand> all_hands;
    for (int i = 0; i < 7462; i++) {
        Hand hand;
        for (int j = 0; j < 5; j++)
            hand.c[j].read(table[i * 5 + j]);
        hand.solve();
        all_hands.push_back(hand);
    }

